import React from 'react';
import { link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav className='navbar bg-dark'>
      <h1>
        <link to='/'>SAWARI</link>
      </h1>
      <ul>
        <li>
          <link to='!#'>SubAdmin</link>
        </li>
        <li>
          <link to='/register'>Register</link>
        </li>
        <li>
          <link to='/login'>Login</link>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
